import React from "react";
import styled from "styled-components";


function NFTList3(props) {
  const { className } = props;

  return (
    <NFTList className={`nft-list-15 ${className || ""}`}>
      <Rectangle8 className="rectangle-8-1" src="/img/rectangle-8@2x.svg" />
    </NFTList>
  );
}

const NFTList = styled.div`
  height: 484px;
